import React from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom" ;

import Main from "./pages/main"
import NavBar from './components/NavBar';

function App() {
  return (
    <Router>

      <Routes>
        <Route exact path="/" element={<Main/>}/>

      </Routes>

    </Router>

  );
}
export default App;
